import React, { useState, useEffect } from 'react';
import './App.css';
import CampoTexto from './componentes/CampoTexto';

const App: React.FC = () => {
  const [nomeServico, setNomeServico] = useState('');
  const [duracao, setDuracao] = useState('');
  const [preco, setPreco] = useState('');
  const [servicos, setServicos] = useState<any[]>([]);

  const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();

    const novoServico = {
      nome: nomeServico,
      duracao: duracao,
      valor: parseFloat(preco), // Valor é o nome esperado pelo back-end
      servicoCategoriaId: 1, // Certifique-se de passar um ID válido ou incluir uma seleção no form
    };

    try {
      const response = await fetch('https://localhost:7265/api/SSubCategorias', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(novoServico),
      });

      if (response.ok) {
        console.log('Serviço criado com sucesso!');
        setNomeServico('');
        setDuracao('');
        setPreco('');
        handleFetchServicos();
      } else {
        console.error('Erro ao criar serviço:', response.statusText);
      }
    } catch (error) {
      console.error('Erro na requisição:', error);
    }
  };

  const handleFetchServicos = async () => {
    try {
      const response = await fetch('https://localhost:7265/api/SSubCategorias'); // Ajustado para usar a rota correta
      if (response.ok) {
        const data = await response.json();
        setServicos(data);
      } else {
        console.error('Erro ao buscar serviços:', response.statusText);
      }
    } catch (error) {
      console.error('Erro na requisição:', error);
    }
  };

  useEffect(() => {
    handleFetchServicos();
  }, []);

  return (
    <div className="container">
      <header className="header">
        <h1>BelezaMarket</h1>
        <button className="account-button">Minha conta</button>
      </header>

      <main className="main-content">
        <section className="service-form">
          <h2>Cadastre um novo serviço</h2>
          <form onSubmit={handleSubmit}>
            <label>
              Serviço
              <input
                type="text"
                placeholder="Digite o nome do serviço"
                value={nomeServico}
                onChange={(e) => setNomeServico(e.target.value)}
              />
            </label>
            <label>
              Duração
              <input
                type="text"
                placeholder="Digite a duração do serviço"
                value={duracao}
                onChange={(e) => setDuracao(e.target.value)}
              />
            </label>
            <label>
              Preço
              <input
                type="text"
                placeholder="Digite o preço do serviço"
                value={preco}
                onChange={(e) => setPreco(e.target.value)}
              />
            </label>
            <button type="submit">Criar Serviço</button>
            <button type="button" onClick={handleFetchServicos}>Puxar Serviços</button>
          </form>
        </section>

        <section className="registered-services">
          <h2>Serviços Cadastrados:</h2>
          {servicos.length > 0 ? (
            servicos.map((servico, index) => (
              <div className="service-card" key={index}>
                <p>Serviço: {servico.nome}</p>
                <p>Duração: {servico.duracao}</p>
                <p>Preço: {servico.valor.toFixed(2)}</p> {/* Ajustado para 'valor' em vez de 'preco' */}
              </div>
            ))
          ) : (
            <p>Nenhum serviço cadastrado.</p>
          )}
        </section>
      </main>
      <CampoTexto />
    </div>
  );
};

export default App;
